"""3. Leia a imagem #43 do dataset, aplique e exiba a Transformação Gamma, variando o parâmetro gamma para os seguintes valores: 0,04; 0,20; 0,67; 1,5; 5,0; 25,0."""

print("\nImagem Original:\n")
cv2_imshow(imagem_2)

# Função para calcular a transformação gamma
def transformacao_gamma(imagem, gamma=1.0):

   invGamma = 1.0 / gamma
   table = np.array([((i / 255.0) ** invGamma) * 255
      for i in np.arange(0, 256)]).astype("uint8")

   return cv2.LUT(imagem, table)

# Chamando os parâmetros
gamma = 0.04
ajuste = transformacao_gamma(imagem_2, gamma=gamma)
print("\nGamma = 0,04\n")
cv2_imshow(ajuste)

