"""8. Leia a imagem disponível neste link, em seguida equalize os tons de cores de cada canal (B, G, R) e exiba a imagem colorida equalizada."""

url_imagem_7 = '/content/COCO_train2014_000000574244.jpg'
imagem_7 = cv2.imread(url_imagem_7)
imagem_7_convertida = cv2.cvtColor(imagem_7, cv2.COLOR_RGB2BGR)
print("Imagem Original:\n")
cv2_imshow(imagem_7)

def equalizacao(img):
  b, g, r = cv2.split(img)

  red = cv2.equalizeHist(r)
  green = cv2.equalizeHist(g)
  blue = cv2.equalizeHist(b)

  return cv2.merge((red, green, blue))

equalizacao(imagem_7_convertida)
print("\nImagem Equalizada:\n")
cv2_imshow(imagem_7_convertida)

